import axios from 'axios';

const API_URL = 'http://localhost:5000/api/search/majors';

export const majorService = {
    getAll: async () => {
        try {
            const response = await axios.get(API_URL);
            return {
                success: true,
                data: response.data
            };
        } catch (error) {
            console.error('Error fetching majors:', error);
            return {
                success: false,
                error: error.message
            };
        }
    }
};
